import React from 'react';

function Heading () {
    var time =  new Date().getHours();
    var greeting;
    
    var sitai = {
    color: "yellow",
    }
    
    if (time >= 0 && time < 12){
        greeting = "good morning";
        sitai.color = "red";
    } else if (time >= 12 && time < 18){
        greeting = "good afternoon";
        sitai.color = "blue";
    } else {
        greeting = "good evening";
        sitai.color = "green";
    }
    return  <h1 style = {sitai}>{greeting}</h1>
}
function calculateplus( a, b ) {
    var c = a + b;
    return c;
}
function calculatedivide(a, b) {
    var c = a / b;
    return c;
}
var xitai = {
    position: "relative",
    color: "blue",
    width: "200px",
    height: "200px",
    marginBottom: "50px",
    textAlign: "center",
    backgroundColor: "black"
}
function Cardz(propz) {
    return ( 
    <div style = {xitai}>
      <p>{propz.id}</p>  
      <p>{propz.name}</p>
      <p>{propz.tel}</p>
      <p>{propz.email}</p>
    </div>
    );
  }
  
export default Heading;
export {calculateplus, calculatedivide, Cardz}
